   Snoop Dogg &amp; Wiz Khalifa ft Bruno Mars - Young,Wild and Free (Music Video)



&quot;Young, Wild &amp; Free&quot; is a collaboration song by rappers Snoop Dogg and Wiz Khalifa.

The song is the lead single from their Mac &amp; Devin Go to High School soundtrack. In an interview with MTV News, Wiz Khalifa said: &quot;This is a family affair, man. Everybody that you see was all involved with the project. We all got love for each other, and you know, we just keeping it moving, right?.












Release Date - 10 October,2011.




